window.bookSummaryJSON = "<p><b>STAY AWAY FROM THE COURT JESTER. ESPECIALLY IF YOU'RE A GOOD LITTLE PRINCESS.</b></p> <p>The Court Jester marks his targets with a ribbon. That's how I find out I'm next. The moment that band of scarlet fabric appears on my pillow, I know it's a promiseâ€”a bad omen delivered by someone wicked.</p> <p>He's powerful. He's sinful. They whisper about him in the castle's shadowed halls. Everyone fears his devilish tongue, yet everyone desires his heated touch.</p> <p>With each seductive temptation, I fall under the jester's spell. With every forbidden moment, he ignites a fire that I've never known before.</p> <p>But the jester is guarding a treasonous secret. And becoming his obsession is dangerous.</p> <p>As a good little princess, I should know. Because if I don't risk my ruin, I'll surely sacrifice my heart.</p> <p>Contains mature themes.</p>"; 
